import { Paper } from '@mui/material';

function ProductBox() {

  return (
    <Fragment>
        <Paper style={{ margin: 20 }}>
            <img style={{ width: '100%', height: 200, margin: 'auto' }} src='productimage.png' alt='product' />
            <div>
                <h1 style={{ margin: 'auto', textAlign: 'center' }}>Pokemon</h1>
                <p style={{ margin: 'auto', textAlign: 'center' }}>Favourite of all time</p>
            </div>
        </Paper>  
    </Fragment>
  )
}

export default ProductBox
